import React from 'react';
import Typography from '@mui/material/Typography';

type HeaderProps = {
  text: string;
};

const Header: React.FC<HeaderProps> = ({ text }) => {
  return <Typography variant="h1" component="h1">{text}</Typography>;
};

export default Header;
